import './App.css';
import { BrowserRouter as Router, Switch, Routes } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Shop from './components/Shop';


function App() {
  return (
   <>
      <Switch>
      <Routes  path="/" exact >
        <Home />
      </Routes>
      <Routes path="/about">
        <About/>
      </Routes>
      <Routes path="/shop">
        <Shop />
      </Routes>
      </Switch>
   </>
  );
}

export default App;
